import React from "react";
import '../bootstrap.css';

class NotFound extends React.Component{
    render(){
        return(
            <div className="d-flex justify-content-center align-items-center h-100 w-100">
                <h1>404 Not Found</h1>
            </div>
        );
    }
}
export default NotFound;
